import{_ as e,o as i,c as a,a as s}from"./index-b8996216.js";const t="/master-website/assets/full_logo-ee564ce1.jpg",n={},l={style:{overflow:"hidden"}},o=s('<div class="2xl:container 2xl:mx-auto lg:py-16 lg:px-20 md:py-12 md:px-6 py-9 px-4"><div class="flex flex-col md:flex-row justify-between gap-8 mt-20"><div class="w-full lg:w-5/12 flex flex-col justify-center"><div class="bg-white p-6 rounded-lg shadow-lg"><p class="text-xl font-semibold text-gray-800">Program Overview</p><p class="text-gray-700 mt-4"> This excellent program provides a strong foundation in the design of artificial intelligence systems and applied mathematics to address the various challenges related to processing and analyzing massive data encountered by businesses. It emphasizes the interplay between machine learning, the management and mining of large datasets, Big Data paradigms, knowledge representation, data processing, and recently developed methodologies. </p></div></div><div class="w-full lg:w-7/12"><img class="w-full h-full" src="https://i.ibb.co/FhgPJt8/Rectangle-116.png" alt="A group of People"></div></div><div class="flex flex-col md:flex-row justify-between gap-8 mt-28"><div class="w-full lg:w-7/12 border-b-2 border-slate-200"><p class="text-xl font-semibold text-gray-800 mt-6">Objectives</p><ul class="list-disc text-gray-700 mt-4 pl-4 list-outside"><li>The ability to master the conceptual, semantic, and algorithmic issues posed by artificial intelligence and data science.</li><li>A comprehensive and in-depth understanding of various facets of AI.</li><li>Solid theoretical knowledge and practical experience in Artificial Intelligence and Data Sciences.</li><li>Knowledge of fundamental concepts in AI and data sciences, including machine learning algorithms, data exploration, computer vision, and natural language processing.</li><li>Practical experience in using tools and technologies for data processing, building machine learning models, and conducting analyses.</li><li>An understanding of the applications of AI and data science in various fields, such as healthcare, business, finance, social sciences, engineering, and more.</li><li>Skills to work in teams, communicate effectively, and present results clearly and concisely.</li><li>Awareness of the ethical and social implications of AI and data science.</li><li>The ability to pursue further studies in AI and data sciences or embark on a career in industry, research, or government.</li></ul></div><div><svg xmlns="http://www.w3.org/2000/svg" width="2" height="500" viewBox="0 0 39 2909" fill="none"><path d="M1 19.4999V2889.5C1 2899.72 9.28273 2908 19.5 2908C29.7173 2908 38 2899.72 38 2889.5V19.5C38 9.28273 29.7173 1 19.5 1C9.28273 1 1 9.28267 1 19.4999Z" fill="black" stroke="black"></path></svg></div><div class="w-full lg:w-5/12 border-b-2 border-slate-200"><p class="text-xl font-semibold text-gray-800 mt-6">Additional Focus</p><p class="text-gray-700 mt-4"> This master&#39;s program also addresses the significant challenge of knowledge management in business intelligence and statistics in the coming years. It considers data accumulated in information systems as capital that should be exploited by applying various computer processing techniques, with statistical methods playing a central role. The program is designed to meet the needs of data processing and ultimately assist in making informed decisions. It encompasses not only scientific and technical considerations but also economic and social aspects related to advancements in statistics, computer science, artificial intelligence, and economic intelligence. </p></div></div><div class="flex flex-col md:flex-row justify-between gap-8 mt-20"><div class="w-full lg:w-8/12"><p class="text-xl font-semibold text-gray-800 mt-6">Program Structure</p><ul class="list-disc list-inside text-gray-700 mt-4 pl-4"><li><strong>Semester 1 (S1):</strong> Preparation with the consolidation of fundamentals in Artificial Intelligence, applied mathematics to data sciences, including mathematics, software development, and unstructured databases.</li><li><strong>Semester 2 (S2):</strong> Developing knowledge and skills to gain expertise in concepts, the Big Data ecosystem, data analysis, statistical regression, statistical learning techniques, complex data mining, graph theory, business intelligence, and software platforms suitable for AI and Data Sciences.</li><li><strong>Semester 3 (S3):</strong> Application to practice effectively while developing complementary knowledge in fields closely related to the development of Intelligent Systems and Learning Systems, such as the Internet of Things, data analysis, complex data processing from the web, and social network analysis.</li></ul><p class="text-gray-700 mt-6"> This master&#39;s program intelligently integrates project management in information technology and introduces students to the corporate culture through experiential learning, the development of start-up projects, and essential aspects of enterprise management using open-source solutions. </p></div><div><svg xmlns="http://www.w3.org/2000/svg" width="2" height="500" viewBox="0 0 39 2909" fill="none"><path d="M1 19.4999V2889.5C1 2899.72 9.28273 2908 19.5 2908C29.7173 2908 38 2899.72 38 2889.5V19.5C38 9.28273 29.7173 1 19.5 1C9.28273 1 1 9.28267 1 19.4999Z" fill="black" stroke="black"></path></svg></div><div class="w-full lg:w-4/12"><p class="text-xl font-semibold text-gray-800 mt-6">Program Goal</p><p class="text-gray-700 mt-4 mb-2"> The ultimate goal of the program is to provide training that combines science and engineering, enabling graduates to understand, master, and advance their knowledge in a value chain that relies on the exploitation of extensive and massive data through intelligent applications. </p><div><img class="md:block hidden w-full mt-8 shadow-md" src="'+t+'" alt="AISD LOGO"></div></div></div><div class="py-4 text-left bg-white rounded-lg shadow-md p-4 mb-20"><h1 class="text-3xl lg:text-4xl font-bold leading-9 text-gray-800 pb-4">SKILLS YOU WILL ACQUIRE :</h1><p class="mt-4"> The <span class="font-semibold">Intelligence Artificial and Data Sciences (IASD)</span> master&#39;s program is designed for computer science students seeking specialization in advanced techniques for modeling and engineering intelligent systems and decision-making. It provides a foundation of knowledge and skills to prepare students for careers in research, research and development, and innovation in this field. </p><p class="mt-4"> In addition to functional competencies, the training in Artificial Intelligence and Data Sciences can help you acquire important technical and professional skills. Here are some of these skills: </p><ul class="list-disc pl-6 mt-4"><li class="mt-2"><span class="font-semibold">Technical Programming Skills:</span> Students develop programming skills using programming languages like Python, R, and Java. You will also learn to use AI and data libraries such as TensorFlow, Keras, PyTorch, and Scikit-Learn. Skills in database management, data analysis, visualization, and modeling are also developed.</li><li class="mt-2"><span class="font-semibold">Machine Learning: </span>Students learn the fundamentals of machine learning, including classification, regression, and clustering techniques. You will also learn to use AI algorithms to solve problems related to text processing, computer vision, and speech recognition.</li><li class="mt-2"><span class="font-semibold">Data Analysis: </span>Students develop skills in data collection, cleaning, exploration, and visualization. You will also learn to use statistical techniques for data analysis and understand how data can be used for business decision-making.</li><li class="mt-2"><span class="font-semibold">Professional Skills: </span>Students acquire skills in project management, communication, and presentation. You will also learn to work effectively in teams and creatively solve problems. You will understand the ethical and legal implications of AI and data usage.</li><li class="mt-2"><span class="font-semibold">Innovation Skills: </span>Students develop skills in creative thinking and innovation, enabling you to propose innovative ideas and solutions for complex problems. You will also learn to apply these skills to AI and data projects, creating new business opportunities and improving process efficiency.</li></ul><p class="mt-4"> Students will master the necessary tools to: </p><ul class="list-disc pl-6 mt-4"><li class="mt-2">Model and solve real-world problems in domains that rely on the exploitation of massive data.</li><li class="mt-2">Design and implement fundamental tools for classifying complex objects to meet specific organizational needs.</li><li class="mt-2">Use advanced knowledge representation formalisms to design solutions tailored to the specific needs of national or international organizations.</li><li class="mt-2">Develop, model, contribute to the implementation, and manage a Big Data information ecosystem.</li></ul><p class="mt-4"> The IASD program equips students with a versatile skill set to excel in the field of Artificial Intelligence and Data Sciences. </p></div></div>',1),c=[o];function r(d,m){return i(),a("body",l,c)}const p=e(n,[["render",r]]);export{p as default};
